@Component({
  selector: 'app-helper',
  templateUrl: './helper.component.html',
  styleUrls: ['./helper.component.css']
})
export class HelperComponent {
    title = 'Helper';
}
<h1><center>
    {{ title }}</center></h1>
<nav>
  <a routerLink="/cupboard">Cupboard</a>
</nav>
